import React, { Component } from 'react';
import { BrowserRouter as Router, Route } from "react-router-dom";
import CreateProfile from "../../pages/CreateProfile"

//import "./style.css";



class CreateProfileBtn extends Component {
  try = () => {
      this.history.push('/create-profile');
  }

  render(){
  return (
    <Router>
         <Route exact path="/create-profile" component={CreateProfile} />
         <button onClick={this.try} type="button" className="btn btn-success float-right">Create a Profile</button>

    </Router>
  );
}
}
export default CreateProfileBtn;
